import React from 'react';
import Header from './Header';
import CreateNote from './CreateNote';
import Note from './Note';
import Footer from './Footer';

const App = () => {
    const AddNote = ()=>{
        alert('hi');
    }
    const DeleteNote = ()=>{
        alert('deleted');
    }
    return (
        
        <>
         <Header />
         <CreateNote func = 'AddNote' />
         <Note func = 'DeleteNote' />
         <Footer /> 
        </>
    )
};

export default App;
